    return React.createElement("svg", { width: 24, height: 24, viewBox: "0 0 24 24", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M13.5 14c.15 0 .3.02.43.06A2.5 2.5 0 0012 16.5v4.92c-1.12.42-2.38.58-3.5.58-2.72 0-6.34-.96-6.5-4.27V15.5c0-.78.6-1.42 1.36-1.5H13.5zm-.5 2.5c0-.83.67-1.5 1.5-1.5h.5v-1a2.5 2.5 0 115 0v1h.54c.81.02 1.46.69 1.46 1.5v5c0 .83-.67 1.5-1.5 1.5h-6a1.5 1.5 0 01-1.5-1.5v-5zm3.5-2.5v1h2v-1a1 1 0 10-2 0zm0 5a1 1 0 102 0 1 1 0 00-2 0zm1-8.5c.82 0 1.57.28 2.17.75a3.5 3.5 0 10-4.34 0c.6-.47 1.35-.75 2.17-.75zM8.5 3a4.5 4.5 0 110 9 4.5 4.5 0 010-9z", fill: primaryFill }));
};
const PeopleLock24Filled = wrapIcon(rawSvg({}), 'PeopleLock24Filled');
export default PeopleLock24Filled;
